def list_of_scales_with_n_notes(notes):
    l = []
    for sc in ethnic_scales:
        if sc[2] == notes:
            l.append(sc)
    return l

def find_scale(noteList):
    superdelta=1200*12
    for sc in ethnic_scales:
        delta = 0.0
        for n in noteList:
            bestDelta = 1200
            for value in sc[4]:
                if value < 2.0:
                    value = (value-1.0)*1200
                if abs(n-value) < bestDelta:
                    bestDelta = abs(n-value)
            delta += bestDelta
        if delta < 60 and sc[2] < 12:
            print(delta, sc[0], sc[1], sc[3])
        if delta <= superdelta:
            superdelta=delta



